burgers.forEach((element,index) => {
    let newelement =``;
    newelement =`
        <div class="burger">       
            <div class="image"><img
                src="${element.image}">
            </div>
            <div class="type">
                <h2>${element.name}</h2>
            </div>
            <div class="bottom">
                <div class="price">${element.price}</div>
                <div class="cart"><i class="fa-solid fa-cart-plus" id="${index}" onclick="orderednow(this.id)"></i></div>
            </div>    
        </div>            
    `
    burgerslist.innerHTML += newelement;          
})
let orderedburgers = [];
function orderednow(index){
    orderedburgers.push(burgers[index]);
    order.innerHTML ="";
    orderedburgers.forEach((element,index) => {
        let neworder = ``;
        neworder =`
        <div class="burger">
            <div class="icon"><img
                src="${orderedburgers[index].image}">
            </div>
            <div class="userorder">
                <h2>${orderedburgers[index].name}</h2>
                <p>$${orderedburgers[index].price}</p>
            </div>
                <div class="delete"><i class="fa-regular fa-circle-xmark" id="${index}" onclick="removeitem(this.id)"></i></div>
        </div>            
        
     `
     order.innerHTML += neworder;
    })
    cashcalc()
}
function removeitem(index){
    orderedburgers.splice(index,1);
    order.innerHTML ="";
    orderedburgers.forEach((element,index) => {
        let neworder = ``;
        neworder =`
        <div class="burger">
            <div class="icon"><img
                src="${orderedburgers[index].image}">
            </div>
            <div class="userorder">
                <h2>${orderedburgers[index].name}</h2>
                <p>$${orderedburgers[index].price}</p>
            </div>
                <div class="delete"><i class="fa-regular fa-circle-xmark" id="${index}" onclick="removeitem(this.id)"></i></div>
        </div>            
        
     `
     order.innerHTML += neworder;
    })
    cashcalc()
}
function cashcalc(){
    let totalcash = 0;
    orderedburgers.forEach(element=>{
        totalcash = totalcash + element.price
    });
    subtotal.innerHTML = '$' + totalcash;
    tax.innerHTML = '$' + (totalcash*10/100);
    total.innerHTML = '$' + (totalcash + (totalcash*10/100));
    iteamsnumber.innerHTML = orderedburgers.length;
}